import "./styles.css";
import { ReactComponent as Logo } from "./logogalinha.svg";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";

function Navbar() {

  // const logout = () =>{
  //    localStorage.clear()
  //   }
    const [idt, setIdt] = useState(0)

    useEffect(() =>{
      const getId: any = localStorage.getItem('user');
      const id = Number(getId);
      setIdt(id);
    }, [])
    console.log(idt);

    const logout = () => localStorage.setItem('user', '0')

  return (
    <nav className="main-navbar">
      <Link to="/" className="logo-text">
        <Logo />
        DelyFood
      </Link>

      {/* <Link to="/Login" className="entrar">
      <b>Entrar</b>
    </Link>  */}

    {idt === 0 ? (
      <Link to="/Login" className="entrar">
      <b>Entrar</b>
    </Link> 
    ) : (
      <Link to="/Login" className="entrar" onClick={logout}>
      <b>Sair</b>
    </Link> 
    )}
    </nav>
  );
}

export default Navbar;
